import React from "react";
import {add,sub,mul,div} from './Calc';
function App(){
    return(
    <>
    <ul>
    <li>Sum of two no is {add(30,3)}</li>
    <li>Sub of two no is {sub(30,3)}</li>
    <li>div of two no is {div(10,3)}</li>
    <li>Mul of two no is {mul(10,3)}</li>
    </ul>
</>
    );
}
export default App;
